import React, { Component } from "react";

import Habits from "./habits";

class HabitBar extends Component {
  render() {
    return (
      <div className="bar-bgcolor">
        <div className="bar">
          <span className="leaf">
            <i className="fa-solid fa-leaf"></i>
          </span>
          <span className="bar-name">Habit Tracker</span>
          <span className="habit-count all">8</span>
        </div>
      </div>
    );
  }
}

export default HabitBar;
